import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Home from './Pages/Home';
import Register from './Pages/Register';
import { NotesContainer } from './Pages/NotesContainer';
import Navbar from './Components/Navbar';
import { Nomatch } from './Components/Nomatch';

const App = () => {
  return (
    <Router>
      <div>
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/register" element={<Register />} />
          {/* Route for displaying all notes */}
          <Route path="/notes" element={<NotesContainer />}>
            {/* Optional: Redirect any unknown route under /notes to Nomatch */}
            <Route path="*" element={<Navigate to="/404" />} />
          </Route>
          {/* Route for displaying a specific note */}
          <Route path="/notes/:noteId" element={<NotesContainer />} />
          <Route path="/404" element={<Nomatch />} />
          <Route path='*' element={<Nomatch/>} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
